import React from 'react'
import { Link } from 'react-router-dom';
import LoginAdmin from './LoginAdmin';

const AdminDashboard = () => {
  return (
      <div className="min-h-screen flex bg-gray-100">
      {/* Sidebar */}
      <aside className="w-64 bg-white shadow-md p-6">
        <div className="font-bold text-xl mb-6 border-b pb-2">Admin Panel</div>
        <nav className="space-y-4">
          <Link to="/" className="block text-blue-500 hover:underline">
            Logout / Login
          </Link>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="flex-1 p-6">
        <h1 className="text-2xl font-bold">Welcome to Admin Dashboard</h1>
        <p className="text-gray-500 mt-2">This is your main dashboard. Nothing fancy here yet!</p>
      </main>
    </div>
  )
}

export default AdminDashboard
